column3:
) || ");
  }

  googletag.pubads().enableLazyLoad({
    fetchMarginPercent: 500,
    renderMarginPercent: 200,
    mobileScaling: 2.0
  });

  // Load ATF slots only on load
  // BTF slots should load when first instance enters the viewport (see assets/scripts/ads.js)

  var slotValues = Object.keys(googletag.slots).map(function(e) {
    return googletag.slots[e]
  });

  var ATFslots = slotValues.filter(function (slot) {
    return !/BTF/gi.test(slot.getSlotId().toString());
  });

  var BTFslots = slotValues.filter(function (slot) {
    return !/ATF/gi.test(slot.getSlotId().toString());
  });

  // Store in queue
  ATFslots.forEach(function (slot) {
    var slotElementId = slot.getSlotElementId();
    googletag.slotsQueued[slotElementId] = slot;
  });

  var amazonSlots = ATFslots.map( function(s) {
    var slotID = s.getSlotElementId();
    var slotName = s.getSlotId().toString();
    var sizes = s.getSizes().map(function(d){return [d.l, d.j]});
    return {
     slotID: slotID,
     slotName: slotName,
     sizes: sizes
    }
  });

  apstag.fetchBids({
    slots: amazonSlots
  }, function(bids) {
    // set apstag targeting on googletag, then trigger the first DFP request in googletag's disableInitialLoad integration
    googletag.cmd.push(function(){
        apstag.setDisplayBids();
        googletag.pubads().refresh(ATFslots);
    });
  });

  googletag.enableServices();

  // Add the rates as a var as this might be variable in the future.
  var atfRate = 60000;
  var btfRate = 40000;
  // set refresh rates.
  setInterval(function(){
    googletag.pubads().refresh(ATFslots);
  },atfRate);

  setInterval(function(){
    googletag.pubads().refresh(BTFslots);
  },btfRate);
});
</script>
